import React from 'react';
import { BrowserRouter as Router,Switch,Route } from "react-router-dom";
import './App.css';
import HomePage from './Profiles/HomePage';
import Login from './Profiles/Login';

function App() {
  const user=null;

  return (
    <div className="app">
      <Router>
        <Switch>
        {user?
          <Route>
            <HomePage />
          </Route>
            :
          <Route>
            <Login/>
          </Route>
        } 
        </Switch>
    </Router>
    </div>
  );
}

export default App;
